// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract BountyEscrow {
    struct Bounty {
        address owner;
        uint256 amount;
        address finder;
        bool isClaimed;
    }

    mapping(uint256 => Bounty) public bounties;

    event BountyLocked(uint256 indexed itemId, address indexed owner, uint256 amount);
    event BountyClaimed(uint256 indexed itemId, address indexed finder, uint256 amount);

    modifier onlyOwner(uint256 _itemId) {
        require(msg.sender == bounties[_itemId].owner, "Not item owner");
        _;
    }

    function lockBounty(uint256 _itemId) external payable {
        require(msg.value > 0, "Bounty must be greater than 0");
        require(bounties[_itemId].amount == 0, "Bounty already exists");

        bounties[_itemId] = Bounty(msg.sender, msg.value, address(0), false);
        emit BountyLocked(_itemId, msg.sender, msg.value);
    }

    function claimBounty(uint256 _itemId, address _finder) external onlyOwner(_itemId) {
        Bounty storage bounty = bounties[_itemId];
        require(!bounty.isClaimed, "Bounty already claimed");
        require(bounty.amount > 0, "No bounty available");

        bounty.finder = _finder;
        bounty.isClaimed = true;
        payable(_finder).transfer(bounty.amount);

        emit BountyClaimed(_itemId, _finder, bounty.amount);
    }
}

